const ResizeHandle = ({ onMouseDown }) => {
  return (
    <div
      onMouseDown={onMouseDown}
      style={{
        width: 18,
        height: 18,
        position: "absolute",
        right: 0,
        bottom: 0,
        cursor: "nwse-resize",
        background: "rgba(3, 2, 2, 0.52)",
        borderTopLeftRadius: 6,
      }}
    />
  );
};

export default ResizeHandle;
